import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    count: 1
  },
  getters: {
    getHandleCount: function (state) {
      return state.count + 1
    }
  },
  mutations: {
    addFun (state) {
      state.count = state.count + 1
    },
    redFun (state,n) {
      state.count = state.count - n
    }
  },
  actions: {
    add (context) {
      context.commit('addFun')
    },
    red (context, n) {
      context.commit('redFun', n)
    }
  }
})
